import axios from 'axios';
import { login_user } from '../constant/userConstant';



export const userLogin = async  (mydata)=>{
    try {
        const config = {
            headers: { "Content-Type": "application/json" },
          };
        const data = await axios.post('/api/v1/login',mydata,config)
          console.log(data);

          return{
            type: login_user,
            payload: data
        };
    } catch (error) {
        console.log(error);
    }

};
